import React from 'react';
import * as ReactDOMClient from 'react-dom/client';
import { useState, useEffect } from 'react';
import {
  Grid,
  Alert,
  Button,
  FormControl,
  InputLabel,
  OutlinedInput,
  FormHelperText,
  FormControlLabel,
  Slider,
  Switch,
  Typography,
  List,
  ListItem,
  ListItemText,
  IconButton,
  CssBaseline,
  Divider,
  SvgIcon,
} from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import { LoadingButton } from '@mui/lab';
import '@fontsource/roboto/300.css';
import '@fontsource/roboto/400.css';
import '@fontsource/roboto/500.css';
import '@fontsource/roboto/700.css';
import ContentCopyIcon from '@mui/icons-material/ContentCopy';
import './popup.css';
import mixpanel from 'mixpanel-browser';
import jwt_decode from 'jwt-decode';
import palette from './palette';
import typography from './typography';
import shadows, { customShadows } from './shadows';
import breakpoints from './breakpoints';

const theme = createTheme({
  palette: palette.light,
  typography,
  breakpoints,
  shadows: shadows.light,
  customShadows: customShadows.light,
  shape: { borderRadius: 4 },
  direction: 'ltr',
});

/**
 * Popup - The main popup component.
 */
function Popup() {
  const mixpanelConfig =
    process.env.NODE_ENV !== 'production'
      ? { debug: true, api_host: 'https://api.mixpanel.com', ignore_dnt: true }
      : { api_host: 'https://api.mixpanel.com', ignore_dnt: true };
  mixpanel.init(process.env.MIXPANEL_TOKEN, mixpanelConfig);

  const MAX_FREE_USES = 10;
  const MAX_BASIC_USES = 25;
  const MAX_PREMIUM_USES = 100;
  const [isAuthenticated, setIsAuthenticated] = useState(false);
  const [maxUsage, setMaxUsage] = useState(MAX_FREE_USES);
  const [userPlan, setUserPlan] = useState('free');
  const [isLowercase, setIsLowercase] = useState(false);
  const [usageCount, setUsageCount] = useState(0);
  const [displayError, setDisplayError] = useState(false);
  const [emailBody, setEmailBody] = useState('');
  const [emailBodyEmptyError, setEmailBodyEmptyError] = useState(false);
  const [creativity, setCreativity] = useState(85);
  const [subjectLines, setSubjectLines] = useState([]);
  const [subjectLinesLoading, setSubjectLinesLoading] = useState(false);

  /**
   * isAuthenticated - Checks if the user is authenticated by checking if the access_token, expires_in, and id_token are in session storage.
   */
  async function checkIsAuthenticated() {
    const res = await chrome.storage.session.get([
      'access_token',
      'expires_in',
      'id_token',
    ]);
    if (res.access_token && res.expires_in && res.id_token) {
      setIsAuthenticated(true);
      return true;
    }

    return false;
  }

  /**
   * getUserInfo - Sends a message to the background script to get the user info.
   */
  async function getUserInfo() {
    var res = await chrome.runtime.sendMessage({ type: 'getUserInfo' });
    if (res?.result) {
      const { usage_count, plan } = res.result.user_metadata;
      setUsageCount(usage_count);
      if (plan === 'basic') {
        setUserPlan('basic');
        setMaxUsage(MAX_BASIC_USES);
      } else if (plan === 'premium') {
        setUserPlan('premium');
        setMaxUsage(MAX_PREMIUM_USES);
      }
      mixpanel.register({ plan: plan, usage_count: usage_count });
    } else {
      setDisplayError(true);
    }
  }

  /**
   * getEmailBody - Sends a message to the background script to get the email body.
   */
  async function getEmailBody() {
    var res = await chrome.runtime.sendMessage({ type: 'getEmailBody' });
    if (res?.result) {
      setEmailBody(res.result.emailBody);
    }
  }

  /**
   * login - Sends a message to the background script to login the user.
   */
  async function login() {
    var result = await chrome.runtime.sendMessage({ type: 'login' });
    if (result.result === true) {
      setIsAuthenticated(true);
      getUserInfo();
      const { id_token } = await chrome.storage.session.get('id_token');
      const { sub } = jwt_decode(id_token);
      mixpanel.identify(sub);
      mixpanel.track('Login', { Source: 'Extension' });
    }
  }

  /**
   *
   * @param {string} emailBody
   */
  async function generateSubjectLines() {
    setSubjectLinesLoading(true);
    var res = await chrome.runtime.sendMessage({
      type: 'generateSubjectLines',
      payload: {
        emailBody: emailBody,
        creativity: creativity,
        lowercase: isLowercase,
      },
    });
    if (res?.result) {
      setSubjectLines(res.result);
      chrome.storage.session.set({ subjectLines: res.result });
      setDisplayError(false);
      mixpanel.track('Generate Subject Lines', { Source: 'Popup' });
      userPlan === 'free' ? setUsageCount(usageCount + 1) : null;
    } else {
      setDisplayError(true);
    }
    setSubjectLinesLoading(false);
  }

  // On Click Functions

  /**
   * openHelp - Opens the help page in a new tab.
   */
  function openHelp() {
    mixpanel.track('Extension Help Button Clicked');
    chrome.tabs.create({ url: `${process.env.CLIENT_APP_URL}/dashboard/help` });
  }

  /**
   * openDashboard - Opens the dashboard page in a new tab.
   */
  function openDashboard() {
    chrome.tabs.create({ url: `${process.env.CLIENT_APP_URL}/dashboard` });
  }

  /**
   * openReview - Opens the extension review page in a new tab.
   */
  function openReview() {
    mixpanel.track('Extension Review Button Clicked');
    chrome.tabs.create({ url: `${process.env.EXT_STORE_URL}` });
  }

  /**
   * openUpgrade - Opens the upgrade page in a new tab.
   */
  function openUpgrade() {
    mixpanel.track('Extension Upgrade Button Clicked');
    chrome.tabs.create({
      url: `${process.env.CLIENT_APP_URL}/pricing`,
    });
  }

  /**
   * geti18nText - Gets the i18n text for the given message.
   * @param {string} msg
   * @returns {string}
   */
  function geti18nText(msg, tokens) {
    return chrome.i18n.getMessage(msg, tokens);
  }

  useEffect(() => {
    checkIsAuthenticated().then((isAuth) => {
      if (isAuth) {
        // Get the user info from the background script.
        getUserInfo();
        // Get the email body from the background script if popup is opened from the content script.
        getEmailBody();
        // get any previously generated subject lines from storage
        chrome.storage.session.get('subjectLines', (res) => {
          if (res.subjectLines) {
            setSubjectLines(res.subjectLines);
          }
        });
      }
    });
  }, []);

  let planAlert = null;
  if (userPlan === 'free' && isAuthenticated) {
    planAlert = (
      <Grid item xs={12}>
        <Alert
          severity="warning"
          action={
            <Button
              color="inherit"
              variant="outlined"
              size="small"
              onClick={openUpgrade}
            >
              {geti18nText('upgrade')}
            </Button>
          }
        >
          <strong>
            {geti18nText('freeUsesLeft', [`${usageCount}`, `${maxUsage}`])}
          </strong>
        </Alert>
      </Grid>
    );
  } else if (userPlan === 'basic' && isAuthenticated) {
    planAlert = (
      <Grid item xs={12}>
        <Alert
          severity="info"
          action={
            <Button
              color="info"
              variant="outlined"
              size="small"
              onClick={openUpgrade}
            >
              {geti18nText('upgrade')}
            </Button>
          }
        >
          <strong>
            {geti18nText('paidMonthlyUsage', [`${usageCount}`, `${maxUsage}`])}
          </strong>
        </Alert>
      </Grid>
    );
  } else if (userPlan === 'premium' && isAuthenticated) {
    planAlert = (
      <Grid item xs={12}>
        <Alert severity="info">
          <strong>
            {geti18nText('paidMonthlyUsage', [`${usageCount}`, `${maxUsage}`])}
          </strong>
        </Alert>
      </Grid>
    );
  }

  return (
    <ThemeProvider theme={theme}>
      <CssBaseline />
      <Grid container rowSpacing={1} padding="18px">
        <Grid container item xs justifyContent="flex-start">
          <IconButton onClick={openDashboard}>
            <SvgIcon viewBox="0 0 512 512">
              <path
                d="M60 127C60 114.297 70.2975 104 83 104H430C442.703 104 453 114.297 453 127V384.414C453 397.117 442.703 407.414 430 407.414H83C70.2975 407.414 60 397.117 60 384.414V127Z"
                fill="url(#pattern0)"
              />
              <defs>
                <pattern
                  id="pattern0"
                  patternContentUnits="objectBoundingBox"
                  width="1"
                  height="1"
                >
                  <use
                    xlinkHref="#image0_5_9740"
                    transform="matrix(0.00166389 0 0 0.00215517 -0.349418 -0.614224)"
                  />
                </pattern>
                <image
                  id="image0_5_9740"
                  width="1024"
                  height="1024"
                  xlinkHref="data:image/jpeg;base64,"
                />
              </defs>
            </SvgIcon>
          </IconButton>
          <Typography id="title" variant="h3">
            {geti18nText('extName')}
          </Typography>
        </Grid>
        {!isAuthenticated && (
          <Grid item xs={12}>
            <Alert
              severity="info"
              action={
                <Button
                  variant="outlined"
                  color="info"
                  size="small"
                  onClick={login}
                >
                  {geti18nText('login')}
                </Button>
              }
            >
              {geti18nText('loginAlert')}
            </Alert>
          </Grid>
        )}
        {planAlert}
        {displayError && (
          <Grid item xs={12}>
            <Alert severity="error" hidden={!displayError}>
              {geti18nText('errorAlert')}
            </Alert>
          </Grid>
        )}

        <Grid item xs={12}>
          <Divider />
          <List>
            {subjectLines.map((subjectLine, index) => (
              <ListItem
                key={index}
                secondaryAction={
                  <IconButton
                    edge="end"
                    aria-label="copy to clipboard"
                    onClick={() => {
                      navigator.clipboard.writeText(subjectLine.text);
                    }}
                  >
                    <ContentCopyIcon />
                  </IconButton>
                }
              >
                <ListItemText primary={`${subjectLine.text}`}></ListItemText>
              </ListItem>
            ))}
          </List>
        </Grid>
        <Grid item xs={12}>
          <Typography variant="subtitle1" gutterBottom component="div">
            {geti18nText('creativityLevel')}
          </Typography>
          <Slider
            defaultValue={85}
            aria-label="Creativity slider"
            valueLabelDisplay="auto"
            onChange={(e, value) => setCreativity(value)}
            min={0}
            max={100}
            sx={{ color: 'primary.dark' }}
            disabled={!isAuthenticated || usageCount >= maxUsage}
          />
        </Grid>
        <Grid item xs={12}>
          <FormControl
            disabled={!isAuthenticated || usageCount >= maxUsage}
            error={emailBodyEmptyError}
            fullWidth={true}
            required={true}
          >
            <InputLabel htmlFor="email-body">
              {geti18nText('emailTextAreaLabel')}
            </InputLabel>
            <OutlinedInput
              id="email-body"
              label={geti18nText('emailTextAreaLabel')}
              placeholder={geti18nText('emailTextAreaHint')}
              onChange={(e) => setEmailBody(e.target.value)}
              value={emailBody}
              multiline
              minRows={4}
            ></OutlinedInput>
            {emailBodyEmptyError && (
              <FormHelperText id="email-body-error-text" error={true}>
                {geti18nText('emailBodyErrorText')}
              </FormHelperText>
            )}
          </FormControl>
        </Grid>
        <Grid item xs={12}>
          <FormControlLabel
            control={
              <Switch
                onChange={(e) => setIsLowercase(e.target.checked)}
                disabled={!isAuthenticated || usageCount >= maxUsage}
              />
            }
            label={geti18nText('lowercaseSubjectLines')}
          />
        </Grid>
        <Grid container item xs justifyContent="flex-start">
          <Button variant="text" color="inherit" onClick={openHelp}>
            {geti18nText('help')}
          </Button>
          <Button variant="text" color="inherit" onClick={openReview}>
            {geti18nText('giveUsAReview')}
          </Button>
        </Grid>
        <Grid container item xs={3} justifyContent="flex-end">
          <LoadingButton
            variant="contained"
            color="primary"
            size="medium"
            loading={subjectLinesLoading}
            disabled={!isAuthenticated || usageCount >= maxUsage}
            onClick={() => {
              if (emailBody.trim() === '') {
                setEmailBodyEmptyError(true);
              } else {
                setEmailBodyEmptyError(false);
                generateSubjectLines();
              }
            }}
          >
            <span>{geti18nText('generate')}</span>
          </LoadingButton>
        </Grid>
      </Grid>
    </ThemeProvider>
  );
}

const target = document.getElementById('react-target');
const root = ReactDOMClient.createRoot(target);

root.render(<Popup />);
